(1, 'main page', ' __notitle__ what isu800 openrov what isu800 openrov what isu800 openrov style background-color #ffffff; width 95u800 - style width 50u800 ; background-color white; openrov isu800 au8e280a8 dou800 itu800 yourself telerobotics community centered around underwater exploration andu800 education. weu800 have developed au800 lowu800-cost telerobotic submarine that canu800 beu800 built with mostly offu800-theu800-shelf partsu82eu8e280a8the goal ofu800 openrov isu800 tou800 democratize exploration byu800 allowing anyone tou800 explore andu800 study underwater environments. theu800 u8e280a8 openrov community isu800 also laying theu800 foundation foru800 globally-connected citizen scientists tou800 share their data andu800 findingsu82eu8e280a8 questions oru800 suggestions feel free tou800 email usu800 atu800 info openrovu82ecomu800 . style width 50u800 ; -- this version ofu800 theu800 embed code isu800 nou800 longer supported. learn more -- openrov meets theu800 openwater from gerty onu800 vimeo . where canu800 iu800 getu800 help where canu800 iu800 getu800 help where canu800 iu800 getu800 help ifu800 youu800 need help following instructions oru800 ifu800 youu800''reu800 stuck atu800 some step andu800 something hasu800 gone wrong there areu800 several ways tou800 getu800 help from theu800 openrov users andu800 developer community. first carefully reu800-read andu800 review allu800 applicable instructions andu800 make sure youu800 didn''tu800 dou800 something wrong oru800 outu800 ofu800 sequence. many ofu800 these instructions involve long commands andu800 just oneu800 wrong character will mess theu800 whole thing upu800. additionally youu800 canu800 also check theu800 troubleshooting page foru800 additional information. ifu800 youu800 continue tou800 have issues asku800 theu800 community foru800 help. your resources foru800 help include openrov wiki u8e28094 foru800 searching & contributing documentation; registration isu800 required tou800 contribute. open