(31, 'softwarearchitecture', ' architectural overview theu800 main architecture foru800 rovision isu800 that ofu800 theu800 client-server model where theu800 rovu800 hosts theu800 server andu800 your computer isu800 theu800 client. theu800 connection tou800 theu800 client isu800 managed through websockets using socketu82eiou800 . theu800 twou800 main technologies weu8e28099re using foru800 rovision areu800 nodeu82ejsu800 andu800 opencv . nodeu82ejsu800 isu800 sort ofu800 like theu800 u8e2809cbrainsu8e2809d ofu800 theu800 rovu800 - itu800 bridges theu800 connection between theu800 rovu800 andu800 theu800 user. itu800 canu800 also beu800 separated into twou800 other sections visual input andu800 control input. theu800 visual input isu800 theu800 images from theu800 onu800-board webcam andu800 theu800 control input comes from theu800 user iu800u82eeu800. keyboard oru800 gamepad control . when theu800 user connects tou800 theu800 node server itu800 spawns au800 child process - theu800 camera capture process. theu800 capture process isu800 where oneu800 canu800 leverage theu800 power ofu800 opencv tou800 utilize amazing computer vision algorithms. this process constantly waits foru800 output from theu800 node server inu800 theu800 form ofu800 timestamp-format strings over standard input stdin . essentially theu800 node process says u8e2809ctake au800 photou8e2809d sayu800 30u800 times peru800 second tou800 theu800 capture process which then captures andu800 saves theu800 photo tou800 shared memory after which itu800 writes theu800 timestamp-format string through standard outu800 stdout tou800 theu800 node server - asu800 au800 sort ofu800 u8e2809chere youu800 gou8e2809d response. theu800 node server then opens theu800 file ofu800 theu800 name itu800 receives timestamp-format string andu800 reads itu800 asu800 au800 base64-encoded string. then theu800 node server sends that string tou800 theu800 client. theu800 client receives theu800 base64-encoded string through javascript which then updates theu800 source attribute ofu800 theu800 imgu800 tagu800 tou800 that string. theu800 user sees au800 newu800 image. since socketu82eiou800 isu800 au800 twou800-wayu800 communication layer theu800 user canu800 send control commands tou800 theu800 rovu800 anytime. theu800 user does sou800 byu800 interacting with theu800 keyboard oru800 gamepad which sends string-formatted commands using javascript tou800 theu800 rovu800. theu800 node server onu800 theu800 rovu800 then intercepts theu800 move command which itu800 then forwards tou800 theu800 onu800-board arduino tou800 actuate theu800 motors. '),
